import React, { useState } from "react";
import "./DeliveryAddress.css";

const DeliveryAddress = ({ onSelectAddress }) => {
  const [addresses, setAddresses] = useState([]);
  const [addingNew, setAddingNew] = useState(false);

  const [newAddress, setNewAddress] = useState({
    fullName: "",
    mobile: "",
    house: "",
    area: "",
    landmark: "",
    pincode: "",
    city: "",
    state: "",
    isDefault: false,
  });

  const handleAddAddress = (e) => {
    e.preventDefault();

    const updatedList = [...addresses, newAddress];

    setAddresses(updatedList);
    setNewAddress({
      fullName: "",
      mobile: "",
      house: "",
      area: "",
      landmark: "",
      pincode: "",
      city: "",
      state: "",
      isDefault: false,
    });

    setAddingNew(false);
  };

  return (
    <div className="delivery-container">
      <h3>Delivery Address</h3>

      {/* Saved Address List */}
      {addresses.length > 0 && (
        <div className="address-list">
          {addresses.map((addr, index) => (
            <div key={index} className="address-box">
              <input
                type="checkbox"
                onChange={() => onSelectAddress(addr)}
              />
              <div>
                <p><strong>{addr.fullName}</strong> ({addr.mobile})</p>
                <p>{addr.house}, {addr.area}</p>
                <p>{addr.city} - {addr.pincode}</p>
                <p>{addr.state}</p>
              </div>
            </div>
          ))}
        </div>
      )}

      {/* + Add New Address Button */}
      {!addingNew && (
        <button className="add-new-btn" onClick={() => setAddingNew(true)}>
          + Add New Address
        </button>
      )}

      {/* New Address Form */}
      {addingNew && (
        <form className="address-form" onSubmit={handleAddAddress}>

          <input
            type="text"
            placeholder="Full Name"
            required
            value={newAddress.fullName}
            onChange={(e) =>
              setNewAddress({ ...newAddress, fullName: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="Mobile Number"
            required
            value={newAddress.mobile}
            onChange={(e) =>
              setNewAddress({ ...newAddress, mobile: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="House / Flat No."
            required
            value={newAddress.house}
            onChange={(e) =>
              setNewAddress({ ...newAddress, house: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="Area / Street"
            required
            value={newAddress.area}
            onChange={(e) =>
              setNewAddress({ ...newAddress, area: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="Landmark"
            value={newAddress.landmark}
            onChange={(e) =>
              setNewAddress({ ...newAddress, landmark: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="Pincode"
            required
            value={newAddress.pincode}
            onChange={(e) =>
              setNewAddress({ ...newAddress, pincode: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="Town / City"
            required
            value={newAddress.city}
            onChange={(e) =>
              setNewAddress({ ...newAddress, city: e.target.value })
            }
          />

          <input
            type="text"
            placeholder="State"
            required
            value={newAddress.state}
            onChange={(e) =>
              setNewAddress({ ...newAddress, state: e.target.value })
            }
          />

          <label className="checkbox-label">
            <input
              type="checkbox"
              checked={newAddress.isDefault}
              onChange={(e) =>
                setNewAddress({ ...newAddress, isDefault: e.target.checked })
              }
            />
            Make this my default address
          </label>

          <button className="save-address-btn">Use This Address</button>
        </form>
      )}
    </div>
  );
};

export default DeliveryAddress;
